    "2015-07-23T03:28:37.405662",nt"name": "refuge-narrative-report-carolina-sandhills-national-wildlife-refuge-january-to-december-19-66004",nt"isopen":
    false,nt"url": null,nt"notes": "This collection of narrative reports for
    Carolina Sandhills National Wildlife Refuge summarizes refuge activities from January
    through December 1962. The report begins with a summary of weather and habitat conditions
    during the period. Wildlife including migratory birds, upland game birds, big game
    animals, fish, and furbearers is also covered. A refuge development and maintenance
    section covers physical development, farming activities, and fires. A resource management
    section discusses grazing and timber removal. A public relations section outlines
    recreational use and refuge visitation is provided at the end of the report. Items
    of interest are provided at the end of the report.",nt"license_title": "License
